import { useParams, Navigate } from "react-router-dom";
import PlatformSettings from "./PlatformSettings";
import ModelProfileSettings from "./ModelProfileSettings";
import PricingSettings from "./PricingSettings";
import PaymentSettings from "./PaymentSettings";
import LocationSettings from "./LocationSettings";

export default function SettingsLayout() {
  const { section } = useParams();

  const sections = {
    platform: <PlatformSettings />,
    model: <ModelProfileSettings />,
    pricing: <PricingSettings />,
    payments: <PaymentSettings />,
    media: <LocationSettings />,
    seo: <div>SEO Settings</div>,
    email: <div>Email Settings</div>,
    security: <div>Security Settings</div>,
    legal: <div>Legal Content</div>,
    features: <div>Feature Toggles</div>,
  };

  if (!sections[section]) {
    return <Navigate to="/admin/settings/platform" replace />;
  }

  return (
    <div className="card p-4">
      <h3 className="mb-3 text-capitalize">{section} Settings</h3>
      {sections[section]}
    </div>
  );
}
